    const state={view:[],sortKey:'Counter',sortDir:'desc',visible:20};

    function sortData(arr){
      const key=state.sortKey;const dir=state.sortDir==='asc'?1:-1;
      return arr.slice().sort((a,b)=>{
        let va=a[key],vb=b[key];
        if(key==='Frequency'||key==='Counter'){va=+va;vb=+vb;}
        else{va=(va||'').toLowerCase();vb=(vb||'').toLowerCase();}
        if(va<vb)return-1*dir;if(va>vb)return 1*dir;return 0;
      });
    }

    function render(scrollAction = null){
      const tbody=document.getElementById('tbody');
      tbody.innerHTML='';
      const rows=state.view.slice(0,state.visible);
      for(const r of rows){
        const tr=document.createElement('tr');
        tr.innerHTML=`<td>${r.Title}</td><td><a href="${r.Link}" target="_blank">${r.Link}</a></td><td>${r.Frequency}</td><td>${r.Counter}</td>`;
        tbody.appendChild(tr);
      }
      document.getElementById('showLess').disabled=state.visible<=20;
      document.getElementById('showMore').disabled=state.visible>=state.view.length;
    
	  // Scroll to new data if action was provided
	  if (scrollAction) {
		setTimeout(() => scrollToNewData(scrollAction), 100);
	  }
	}

    function init(){
      state.view=data.sort((a,b)=>b.Counter-a.Counter||b.Frequency-a.Frequency);
      render();
    }


	document.getElementById('showMore').onclick=()=>{
	  const prevVisible = state.visible;
	  state.visible=Math.min(state.visible+20,state.view.length);
	  if (state.visible > prevVisible) {
		render('showMore');
	  } else {
		render();
	  }
	};
    
	document.getElementById('showLess').onclick=()=>{
	  state.visible=Math.max(20,state.visible-20);
	  render('showLess');
	};
	
    document.getElementById('randomBtn').onclick=()=>{
      state.view=state.view.sort(()=>Math.random()-.5);
      render();
    };

    document.querySelectorAll('th').forEach(th=>{
      th.onclick=()=>{
        const key=th.dataset.key;
        if(state.sortKey===key){state.sortDir=state.sortDir==='asc'?'desc':'asc';}
        else{state.sortKey=key;state.sortDir='asc';}
        state.view=sortData(state.view);
        render();
      };
    });
	
	function scrollToNewData(action) {
	  const container = document.getElementById('tableContainer');
	  const tbody = document.getElementById('tbody');
	  const rows = tbody.children;
	  
	  if (action === 'showMore' && rows.length > 20) {
		// Scroll to show the newly added rows
		const targetRow = rows[Math.max(0, rows.length - 20)];
		if (targetRow) {
		  targetRow.scrollIntoView({ behavior: 'smooth', block: 'start' });
		}
	  } else if (action === 'showLess') {
		// Scroll to the top when showing less
		container.scrollTo({ top: 0, behavior: 'smooth' });
	  }
	}

    init();